import React from 'react'
import LoginBtn from './components/LoginBtn'
import LogoutBtn from './components/LogoutBtn'

function Login() {
        return (
            <main className="column">
                <h1>Login</h1>                    
                    <LoginBtn/>
                    <LogoutBtn/>
            </main>
                
        )
    }

export default Login
